  B.Agr. / Ruby / Java
baseurl: "" # the subpath of your site, e.g. /blog
url: https://oriverk.github.io # the base hostname & protocol for your site, e.g. http://example.com
twitter: not_you_die 
github: oriverk
wantedly: 40069986
linkedin: yudai-k
lapras: CF9OBXY
qiita: OriverK
image: data:image/jpeg;base64,
