# Google Analytics
google_analytics: UA-131793403-3

# Build settings
markdown: kramdown
# theme: minima default
remote_theme: fongandrew/hydeout # added

plugins:
  - jekyll-feed
  - jekyll-paginate # added
  - jekyll-remote-theme # added
  - github-pages # added
  - jekyll-coffeescript # added for scss

author:
  name: 'OriverK'
  url: https://qiita.com/OriverK

# Posts per page:
paginate: 5
paginate_path: '/blog/page:num'

sidebar_home_link: false
sidebar_blog_link: '/blog/'

